import React from "react";
import { NavLink } from 'react-router-dom'
import { Nav, Navbar } from "react-bootstrap";
import "../../index.css";

const Header = () => {
  return (
	    <Navbar collapseOnSelect expand="sm" className="navbar navbar-expand-lg navbar-light mb-3">
	      <div className="container">
	        <Navbar.Brand>
	          <a href="">
	            <img
	              className='img50'
	              src="https://metalit.oss-ap-southeast-5.aliyuncs.com/static/metalit/assets/images/Group_38_1.png"
	            />
	          </a>
	        </Navbar.Brand>

	        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
	        <Navbar.Collapse id="responsive-navbar-nav">
	          <Nav className="navbar-nav ms-auto mb-2 mb-lg-0">
	            <Nav.Link className="nav-item text-uppercase px-3 " href="">Pelatihan</Nav.Link>
	            <NavLink to="/" className="nav-item text-uppercase px-3 nav-link active">Blog</NavLink>
	            <Nav.Link className="nav-item text-uppercase px-3 " href="">Tentang Kami</Nav.Link>
	          </Nav>
	        </Navbar.Collapse>
	        </div>
	     </Navbar>
    );
  };

export default Header;
